import React from "react";
const Post = ()=>{
    return(
        <div className="post">
            <div>
                <div className="postF">
                  <div className="postFF">
                    <div className="postimg">
                      <img src="/images/images.png" placeholder="img" />
                      </div>
                      <a>dibya</a>
                  </div>
                </div>
            </div>
        </div>
    );
}
export default Post;
